#!/usr/bin/perl

use strict;
use warnings;
use autodie;
use Getopt::Long;
use MIME::Base64;
use Term::ReadKey;

# name.........: wdt.pl
# author.......: Rub3nCT
# description..: utility to track and lookup for wireless devices
# thanks to....: HASH-IT (main idea, improvement suggestions, beta-testing...)
# requirements.:
#    - aircrack-ng (mandatory)
#    - Term::ReadKey (mandatory) (you can install it with 'cpan install Term::ReadKey')
#    - sox and libsox-fmt-mp3 (optional / to enable sound) [only tested on debian]

# Usage / help screen
sub usage
{
    print "\n   # Wireless Device Tracker by Rub3nCT #\n\n";
    print " usage: sudo $0 <MODE> [options]\n";
    print "\n  Available working modes (Discovery / Lookup):\n\n";
    print "  -d, --discovery            Track everything around (aka gossip mode)\n\n";
    print "  -l, --lookup               Look for specific devices (comma separated). eg:\n";
    print "       - MAC:                  AA:BB:CC:DD:EE:FF,11:22:33:44:55:66\n";
    print "       - MAC + name:           AA:BB:CC:DD:EE:FF-Laptop,11:22:33:44:55:66-Phone\n";
    print "       - String (ESSID):       [Home],[WLAN]\n";
    print "       - Mixed:                AA:BB:CC:DD:EE:FF,11:22:33:44:55:66-Phone,[WLAN]\n\n";
    print "    -p, --play [file]        Play file (embedded one if no file set) at matching\n\n";
    print " General options:\n\n";
    print "  -i, --interface <interface>  Select the interface to use\n";
    print "  -a, --ap                     Filter: Show APs only\n";
    print "  -s, --sta                    Filter: Show STAs only\n";
    print "  -g, --gap                    Sleep time between prints (in seconds)\n";
    print "  -w, --write <logfile>        Create a log file\n\n";
    print "  -h, --help                   Show this usage screen and exit\n\n";
    exit 1;
}

my $gap = 0;
GetOptions (
    'lookup|l:s'    => \my @lookup,
    'play|p:s'      => \my $play,
    'discovery|d'   => \my $discovery,
    'interface|i=s' => \my $interface,
    'ap|AP|a'       => \my $ap,
    'sta|STA|s'     => \my $sta,
    'g|gap=i'       => \$gap,
    'write|w=s'     => \my $log,
    'help|h|?'      => sub { usage () },
);

# Not for Windows...
if ($^O eq 'MSWin32') {
    die " Sorry, Windows systems are not supported\n";
}

# Must run as root
my $whoami = (getpwuid $>);
if ($whoami ne 'root') {
    print "\n Error: Must run as root!!!\n";
    usage ();
}

# Let's sweep before continuing (just to be sure...)
clean ();

# Be sure that a working mode is selected
if (!defined ($discovery) and !@lookup) {
    usage ();
}

# Avoid both modes selection
if (@lookup and defined ($discovery)) {
    print
        "\n Error: Must select ONLY a working mode (-l / --lookup or -d / --discovery)!!!\n";
    usage ();
}

# Show warning if both filters are selected
if (defined ($ap) and defined ($sta)) {
    print
        "\n Warning: There is no need to select both filters (-a / --ap and -s / --sta)!!!\n";
    print "          This is the default option!!!\n";
}

# We need at least a string to lookup
if (@lookup) {
    my @lookup = split /,/, join q{,}, @lookup;
    if (scalar @lookup < 1) {
        print
            "\n Error: You must add at least one string to match (-l / --lookup)!!!\n\n";
        usage ();
    }
}

# Sound only works with Lookup mode
if (defined ($discovery) and defined ($play)) {
    print "\n Error: -p / --play is only compatible with -l / --lookup!!!\n";
    usage ();
}

# Be sure that we can play the selected file
if (defined ($play)) {
    chomp $play;
    if ($play ne q{} and !-e $play) {
        print "\n Warning: '$play' sound file not found!!!\n";
        print "          Falling back to embedded file!!!\n";
        $play = '/tmp/sound.mp3.gz';
    }
    if ($play eq q{}) {
        $play = '/tmp/sound.mp3.gz';
    }
}

# Force interface selection
if (!defined ($interface)) {
    print
        "\n No interface selected. Please choose one of the available interfaces:\n\n";
    my %interfaces = list ();
    foreach my $interface (keys %interfaces) {
        print "  $interface ($interfaces{$interface} mode)\n";
    }
    print "\n Please, select the interface you want to use:\n  ";
    chomp ($interface = <>);
}

# Get available interfaces and working mode
sub list
{
    my @iwconfig = map { m/^(\w+) / } `iwconfig 2>/dev/null`;
    my %list;
    foreach my $interface (@iwconfig) {
        my $mode = `iwconfig $interface 2>/dev/null | grep 'Mode'`;
        if ($mode =~ /.+Mode:(\w+) /) {
            $list{$interface} = $1;
        }
    }
    return %list;
}

# Now the interface is selected, let's check it
if ($interface ne q{}) {
    my $check = `iwconfig $interface 2>&1 >/dev/null | grep 'No such device'`;
    if ($check ne q{}) {
        print "\n Error: $interface is not an existing device!!!\n\n";
        exit 1;
    }
    my %mode = list ();
    if ($mode{$interface} eq 'Managed') {
        print "\n $interface is not in monitor mode!!!\n";
        print " Putting $interface into monitor mode...\n";
        my $enabled
            = `airmon-ng start $interface 2>/dev/null | grep 'monitor mode enabled'`;
        if ($enabled =~ /monitor mode enabled on (.+)[)]$/) {
            $interface = $1;
            print "\n Monitor mode enabled on $interface\n";
        }
        else {
            print "\n Error: Cannot enable monitor mode on $interface!!!\n\n";
            exit 1;
        }
    }
}

# Set a few variables...
my $temp = '/tmp/wdt-01.csv';
my %seen;    # To store seen lines

######################
### Discovery mode ###
######################
if (defined ($discovery)) {

    # Set default time gap value to 30 seconds if if not set
    # Or set a minimum time gap of 3 seconds to ensure proper working
    # (regardless of user input)
    if ($gap == 0) { $gap = 30 }
    if ($gap < 3)  { $gap = 3 }

    print "\n Using $interface...\n";
    print "\n Discovery mode selected...\n\n";

    # Start scan
    print
        "\n Press 'q' to exit...\n\n IMPORTANT: DON'T PRESS Ctrl^C!!!\n\n\n";
    ReadMode ('cbreak');
    while (1) {
        if (defined (my $exitkey = ReadKey (-1))) {
            last if ($exitkey eq 'q' or $exitkey eq 'Q');
        }
        my @lines = scan ();    # Get a fresh list of found devices
        foreach (@lines) {
            print "$_\n";
        }

        # Print to log if needed
        if (defined ($log)) {
            open my $LOG, '>>', $log;
            foreach my $line (@lines) {
                print {$LOG} "$line\n";
            }
            close $LOG;
        }
    }
    ReadMode ('normal');
    clean ();
    exit 0;
}

###################
### Lookup mode ###
###################
if (@lookup) {

    # Set a minimum time gap of 3 seconds to ensure proper working
    # (regardless of user input)
    if ($gap < 3) { $gap = 3 }

    print "\n Using $interface...\n";
    print "\n Lookup mode selected...\n\n";

    # Check input
    my @match = split /,/, join q{,}, @lookup;

    # First pass. Check if input is valid or exit
    foreach my $str (@match) {
        if ($str !~ /\[.+\]/) {    # Don't check ESSID
            if ($str !~ /.+[-].+/) {    # Don't check MAC + name
                if ($str !~ /^([[:xdigit:]]{2}([:]|$)){6}$/) {
                    print " Error: $str is not a valid MAC!!!\n\n";
                    exit 1;
                }
            }
        }
        if ($str !~ /\[.+\]/) {         # Don't check ESSID
            if ($str =~ /.+[-].+/) {    # Check MAC + name
                my ($MAC) = split /-/, $str;
                if ($MAC !~ /^([[:xdigit:]]{2}([:]|$)){6}$/) {
                    print " Error: $MAC is not a valid MAC!!!\n\n";
                    exit 1;
                }
            }
        }
    }

    # Second pass. Print strings to match (now, without any error)
    foreach my $str (@match) {
        $str =~ tr/][//d;    # Remove ']' and '[', we don't need them anymore
        my ($MAC, $name) = split /-/, $str;
        if (length ($str) > 17) {
            print " Looking for $MAC ($name)\n";
        }
        else {
            print " Looking for $MAC\n";
        }
    }

    # Start scan
    print
        "\n Press 'q' to exit...\n\n IMPORTANT: DON'T PRESS Ctrl^C!!!\n\n\n";
    ReadMode ('cbreak');
    while (1) {
        my $matches = 0;    # Reset match counter
        if (defined (my $exitkey = ReadKey (-1))) {
            last if ($exitkey eq 'q' or $exitkey eq 'Q');
        }
        my @lines = scan ();    # Get a fresh list of found devices
        for (@lines) {
            foreach my $str (@match) {
                my ($match, $name) = split /-/, $str;
                if (/$match/i) {
                    if (defined $name) {    # For MAC + name
                        $_ =~ s/$match/$match \($name\)/;
                    }
                    $matches++;
                    print "$_\n";

                    # Print to log if needed
                    if (defined ($log)) {
                        open my $LOG, '>>', $log;
                        print {$LOG} "$_\n";
                        close $LOG;
                    }
                }
            }
        }

        # Play sound if there is at least one match
        # (only once regardless of the number of matches)
        if ($matches > 0) {
            if (defined ($play)) {
                my $file = sound ();
                system "play $file 2>/dev/null &";
            }
        }
    }
    ReadMode ('normal');
    clean ();
    exit 0;
}

# Parse and return airodump-ng data
sub scan
{
    # Start the scan if the temp file doesn't exists.
    # Data will be saved on /tmp/wdt-01.csv
    if (!-e $temp) {
        system '/bin/sh', '-c',
            "airodump-ng -i $interface -o csv -w /tmp/wdt 2>/dev/null &";
    }

    # Sleep time needed
    sleep $gap;

    # Open airodump-ng output and parse content
    open my $IN, '<', $temp;
    my @lines;
    while (<$IN>) {

        # Set STA as default device type
        my $devicetype = 'STA';

        # Check if the sixth field is a type of privacy, then set type to AP
        if (length ($_) > 1) {
            my ($field1, $field2, $field3, $field4, $field5, $field6)
                = split /,/, $_;
            next
                if ($field1 !~ /^([[:xdigit:]]{2}([:]|$)){6}$/)
                ;    # Don't print headers
            $field6 =~ s/^\s+|\s+$//g;
            if (   ($field6 =~ /OPN/)
                || ($field6 =~ /WEP/)
                || ($field6 =~ /WPA/)
                || ($field6 =~ /WPA2/)
                || ($field6 =~ /WPA2WPA/))
            {
                $devicetype = 'AP';
            }
        }

        # For APs
        if ($devicetype eq 'AP') {
            my ($mac,  $fseen, $lseen, $chan, $speed, $priv, $cip,
                $auth, $power, $beac,  $IV,   $IP,    $ID,   $ESSID
            ) = split /,/, $_;
            $mac =~ s/^\s+|\s+$//g;
            next
                if ($mac !~ /^([[:xdigit:]]{2}([:]|$)){6}$/)
                ;    # Don't print headers
            $ESSID =~ s/^\s+|\s+$//g;
            if ($ESSID !~ /[[:print:]]/) {
                $ESSID = q{};
            }        # Workaround for hidden ESSIDs
            $lseen =~ s/^\s+|\s+$//g;
            $chan =~ s/^\s+|\s+$//g;
            $speed =~ s/^\s+|\s+$//g;
            $priv =~ s/^\s+|\s+$//g;
            $cip =~ s/^\s+|\s+$//g;
            $auth =~ s/^\s+|\s+$//g;
            $power =~ s/^\s+|\s+$//g;

            # Generate text to be printed
            my $line = " AP  $mac";
            if   ($ESSID eq q{}) { $line = "$line with hidden ESSID" }
            else                 { $line = "$line with ESSID $ESSID" }
            $line
                = "$line seen at $lseen (signal $power) ($speed Mbps) (chan $chan) $priv/$auth/$cip";

            # Print only if 'last time seen' has changed
            # If the line has already been seen, check 'last time seen' value
            if (defined $seen{$mac}) {
                if ($seen{$mac} ne $lseen) {
                    if (!defined ($ap) and !defined ($sta))
                    {    # When no filter is selected (default)
                        push @lines, $line;    # Print always
                    }
                    if (defined ($ap)) {       # Print when -a / --ap
                        push @lines, $line;
                    }
                }
            }

            # If the line has not been seen before just continue
            else {
                if (!defined ($ap) and !defined ($sta))
                {    # When no filter is selected (default)
                    push @lines, $line;    # Print always
                }
                if (defined ($ap)) {       # Print when -a / --ap
                    push @lines, $line;
                }
            }
            $seen{$mac} = $lseen;
        }

        # For STAs
        if ($devicetype eq 'STA') {
            my ($mac, $fseen, $lseen, $power, $packets, $BSSID, $probes)
                = split /,/, $_, 7;
            next
                if ($mac !~ /^([[:xdigit:]]{2}([:]|$)){6}$/)
                ;    # Don't print headers
            $mac =~ s/^\s+|\s+$//g;
            $lseen =~ s/^\s+|\s+$//g;
            $power =~ s/^\s+|\s+$//g;
            $BSSID =~ s/^\s+|\s+$//g;
            if (defined $probes) {
                $probes =~ s/^\s+|\s+$//g;
            }

            # Generate text to be printed
            my $line = " STA $mac seen at $lseen (signal $power)";
            if ($BSSID ne q{} and $BSSID !~ /(not associated)/) {
                $line = "$line. Associated with: $BSSID";
            }
            if (defined $probes and $probes ne q{}) {
                $line = "$line. Probed ESSID(s): $probes";
            }

            # Print only if 'last time seen' has changed
            # If the line has already been seen, check 'last time seen' value
            if (defined $seen{$mac}) {
                if ($seen{$mac} ne $lseen) {
                    if (!defined ($ap) and !defined ($sta))
                    {    # When no filter is selected (default)
                        push @lines, $line;    # Print always
                    }
                    if (defined ($sta)) {      # Print when -s / --sta
                        push @lines, $line;
                    }
                }
            }

            # If the line has not been seen before just continue
            else {
                if (!defined ($ap) and !defined ($sta))
                {    # When no filter is selected (default)
                    push @lines, $line;    # Print always
                }
                if (defined ($sta)) {      # Print when -s / --sta
                    push @lines, $line;
                }
            }
            $seen{$mac} = $lseen;
        }
    }
    close $IN;
    return @lines;
}

# Kill all running airodump-ng processes and delete temp files
sub clean
{
    system 'killall airodump-ng 2>/dev/null';
    sleep 1;
    system 'rm -f /tmp/wdt* 2>/dev/null';
    system 'rm -f /tmp/sound* 2>/dev/null';
    return 1;
}

